import { ENDPOINTS } from "../../common/routes";
import { ApiPost } from "../../helpers/apiHelper";

export const registerAPI = async (params) => {
  try {
    const res = await ApiPost(ENDPOINTS.register, params.body);
    console.log(res);
  } catch (error) {}
};
